const personajes = ['Goku', 'Vegeta', 'Trunks'];
const [, , p3] = personajes;
console.log(p3);

const retornaArreglo = () => ['ABC', 123];

const [letras, numeros] = retornaArreglo();

console.log(letras, numeros);

// Tarea

const useStates = valor => [valor, () => console.log('Hola mundo')];

const arr = useStates('Goku');

console.log(arr);
